import styled from "styled-components";

function SearchResultItem(data) {
  return <Container>{data.titel}</Container>;
}

const Container = styled.li`
  position: absolute;
  width: 100%;
  border: 1px solid #ccc;
  border-top: none;
`;

export default SearchResultItem;
